import logo from './logo.svg';
import './App.css';
import Greeting from './Greeting';
import {Add, Sub, Div, Mul} from './Calc';

function App() {
  return (
    <>
    <div className="App">
      <Greeting />
    </div>
    <div>
     <ul>
       <li>{Add(4,5)}</li>
     </ul>
    </div>
    </>
  );
}

export default App;
